        if len(numbers) == 0:
            return 0.0
        mean = sum(numbers) / len(numbers)
        variance = sum((x - mean) ** 2 for x in numbers) / len(numbers)
        return math.sqrt(variance)

    random.seed(42)
    result = {}
    for letter in LETTERS:
        num_list = [random.randint(0, 100) for _ in range(random.randint(1, 10))]
